import React, {Component} from 'react';

class HomeComponent extends Component {
    render() {
        return (
            <div className="card-style">
                <p><span><i className="lni-android sidebar-nav-menu-icon secondary-dark-font"></i></span><span>Artistic Software Engineer with 3 year and 9 months of experience including CryptoCurrency Trading, Location Based Blood Request, Social Club Management system and UBER clone apps.</span></p>
                <p><i className="lni-android sidebar-nav-menu-icon secondary-dark-font"></i>Skilled with Solid understanding of full mobile and software development life cycles, UI/UX and Agile Software Development Methodologies.</p>
                <p><i className="lni-android sidebar-nav-menu-icon secondary-dark-font"></i>Experienced in Google Map api integrations and Firebase Realtime Database chating,</p>
            </div>
        )
    }
}

export default HomeComponent
